Users have to use cluster.x-k8s.io/managed-by: "<name-of-system>" annotation to depict that AWS resources are managed externally. If CAPA controllers come across this annotation in any of the AWS resources while reconciliation, then it will ignore the resource and not perform any reconciliation(including creating/modifying any of the AWS resources, or it's status). A predicate ResourceIsNotExternallyManaged is exposed by Cluster API which allows CAPA controllers to differentiate between externally managed vs CAPA managed resources. For example: c, err := ctrl.NewControllerManagedBy(mgr). For(&providerv1.InfraCluster{}). Watches(...). WithOptions(options). WithEventFilter(predicates.ResourceIsNotExternallyManaged(mgr.GetScheme(),logger.FromContext(ctx))). Build(r)
if err != nil { return errors.Wrap(err, "failed setting up with a controller manager")
} The external system must provide all required fields within the spec of the AWSCluster and must adhere to the CAPI provider contract and set the AWSCluster status to be ready when it is appropriate to do so. IMPORTANT NOTE : Users should take care of skipping reconciliation in external controllers within mapping function while enqueuing requests. For example: err := c.Watch( &source.Kind{Type: &infrav1.AWSCluster{}}, handler.EnqueueRequestsFromMapFunc(func(a client.Object) []reconcile.Request { if annotations.IsExternallyManaged(awsCluster) { log.Info("AWSCluster is externally managed, skipping mapping.") return nil } return []reconcile.Request{ { NamespacedName: client.ObjectKey{Namespace: c.Namespace, Name: c.Spec.InfrastructureRef.Name}, }, }}))
if err != nil { // handle it
}

